module.exports = {
  extends: ['@react-native-community', 'plugin:import/errors'],
  env: {
    node: true,
  },
  rules: {
    'prettier/prettier': [2],
  },
  // @todo: remove once we cover whole codebase with types
  plugins: ['import'],
  settings: {
    'import/resolver': {
      // Use <rootDir>/tsconfig.json for typescript resolution
      typescript: {},
    },
  },
  overrides: [
    {
      files: [
        '**/__mocks__/**',
        '**/__fixtures__/**',
        '**/__e2e__/**',
        'jest/**',
      ],
      env: {
        jest: true,
      },
    },
  ],
};

module.exports = {
  singleQuote: true,
  trailingComma: 'all',
  bracketSpacing: false,
  jsxBracketSameLine: true,
};

module.exports = {
  babelrcRoots: ['packages/*'],
  overrides: [
    {
      presets: ['@babel/preset-typescript'],
      test: '**/*.ts',
    },
  ],
  presets: [
    [
      require.resolve('@babel/preset-env'),
      {
        targets: {node: '18'},
        useBuiltIns: 'entry',
        corejs: '2.x',
      },
    ],
  ],
  plugins: [
    [require.resolve('@babel/plugin-transform-modules-commonjs'), {lazy: true}],
    '@babel/plugin-proposal-export-namespace-from',
  ],
  sourceMaps: true,
};

const common = {
  testEnvironment: 'node',
  snapshotSerializers: [require.resolve('jest-snapshot-serializer-raw')],
  testRunner: 'jest-circus/runner',
};

module.exports = {
  projects: [
    {
      ...common,
      displayName: 'e2e',
      setupFilesAfterEnv: ['<rootDir>/jest/setupE2eTests.js'],
      testMatch: ['<rootDir>/__e2e__/*{.,-}test.[jt]s'],
    },
    {
      ...common,
      displayName: 'unit',
      setupFilesAfterEnv: ['<rootDir>/jest/setupUnitTests.js'],
      testMatch: ['<rootDir>/**/__tests__/*{.,-}test.[jt]s'],
    },
  ],
  collectCoverageFrom: [
    '**/packages/*/**/*.ts',
    '!**/__mocks__/**',
    '!**/__tests__/**',
    '!**/build/**',
  ],
};
